import "../style.css";

export default function NavBar() {
  return (
    <nav className="nav">
      <ul id="nav-menu">
        <CustomLink href="https://nndpznn.github.io/">
          <b>HOME</b>
        </CustomLink>
        <CustomLink href="https://nndpznn.github.io/compsci">
          <b>COMPSCI</b>
        </CustomLink>
        <CustomLink href="https://nndpznn.github.io/photovideo">
          <b>CREATIVE</b>
        </CustomLink>
        <CustomLink href="https://nndpznn.github.io/aboutme">
          <b>ABOUT ME</b>
        </CustomLink>
      </ul>
    </nav>
  );
}

function CustomLink({ href, children, ...props }) {
  const path = window.location.pathname;
  console.log(window.location.pathname);
  return (
    <li className={path === href ? "active" : ""}>
      <a href={href} {...props}>
        {children}
      </a>
    </li>
  );
}
